L470.778,177.281L469.357,177.287L468.15,179.508L469.885,182.437L469.374,183.203L470.897,183.64L471.939,182.49L473.515,181.728L475.401,182.728L474.536,184.482L473.475,184.978L473.656,186.579L472.282,189.302L472.15,190.713L471.257,192.585L471.811,194.702L473.01,196.577L473.294,200.812L472.968,202.028L473.562,203.839L475.315,204.372L476.7,207.633L478.065,209.47L478.209,211.863L479.589,212.535L483.656,215.361L483.366,216.989L481.772,218.271L480.622,218.455L476.739,221.01L474.988,220.298L473.95,220.871L474.038,222.722L473.079,223.887L471.484,223.495L470.138,223.894L469.04,221.676L467.118,223.418L465.151,223.039L463.965,224.165L462.871,224.237L461.19,225.829L458.101,223.604L457.136,224.026L455.293,223.182L454.74,221.463L451.436,221.541L451.53,224.249L451.166,227.224L452.676,228.897L453.201,230.162L454.721,231.049L455.262,232.129L454.042,235.27L450.346,237.548L448.033,234.144L446.042,231.632L442.492,231.336L439.51,230.414L436.062,231.579L435.237,231.56L432.954,229.392L433.263,227.321L432.244,226.902L431.64,224.784L428.513,224.708L424.947,221.654L423.077,222.579L421.231,222.721L420.382,222.161L415.625,221.827L413.702,222.316L408.397,221.126L407.473,220.618L405.987,218.387L404.148,217.452L403.383,215.942L400.655,212.804L398.421,211.082L395.402,209.863Z',
      },
      県外: {
        count: 0,
        area: '県外',
      },
    }

    let last7DaysSum = 0

    Data.patients.data
      .filter((a: any) =>
        dayjs(a.確定日).isAfter(
          dayjs(
            Data.patients_summary.data[Data.patients_summary.data.length - 1]
              .日付
          ).add(-8, 'days') // 確定日の翌日に発表があるので -7 じゃなくて -8
        )
      )
      .forEach((patient) => {
        last7DaysSum++
        // 居住地と滞在地の両方が存在したら、滞在地を優先してカウントする
        // 1. 滞在地が無し、居住地が市町村 => 居住地の市町村に+1
        // 2. 滞在地が無し、居住地が県外 => 県外に+1
        // 3. 滞在地が無し、居住地が管内 => 居住地の管内に+1
        // 4. 滞在地が市町村、居住地が市町村 => 滞在地の市町村に+1
        // 5. 滞在地が市町村、居住地が県外 => 滞在地の市町村に+1
        // 6. 滞在地が市町村、居住地が管内 => 滞在地の市町村に+1
        // 7. 滞在地が管内、居住地が市町村 => 滞在地の管内に+1
        // 8. 滞在地が管内、居住地が管内 => 滞在地の管内に+1
        // 9. 滞在地が管内、居住地が県外 => 滞在地の管内に+1
        // 10. その他
        if (patient.滞在地 === null) {
          if (patient.居住地 in cities) {
            // 1, 2
            cities[patient.居住地].count++
          } else {
            // 3
            const areas = Object.keys(cities).filter(
              (key) => cities[key].area === patient.居住地
            )
            if (areas.length > 0) {
              // 保健所管内が存在する場合は配下の市町村全て+1する
              areas.forEach((a) => {
                cities[a].count++
              })
            }
          }
        } else if (patient.滞在地 in cities) {
          // 4, 5, 6
          cities[patient.滞在地].count++
        } else {
          // 7, 8, 9, 10
          const areas = Object.keys(cities).filter(
            (key) => cities[key].area === patient.滞在地
          )
          if (areas.length > 0) {
            // 保健所管内が存在する場合は配下の市町村全て+1する
            areas.forEach((a) => {
              cities[a].count++
            })
          }
        }
      })

    // データを追加
    const mapData: MapData = PatientMunicipalities.datasets.data
      .filter((d: any) => d.label !== '小計')
      .map((d: any) => {
        return {
          ruby: d.ruby,
          label: d.label,
          area: cities[d.label].area,
          last7days: cities[d.label].count,
          d: cities[d.label].d,
        }
      })

    const date = dayjs(PatientMunicipalities.date).format('YYYY/MM/DD HH:mm')

    const info = {
      lText: `${last7DaysSum}`,
      lTextBefore: this.$t('岩手県全域'),
      sText: this.$t('居住地が県外で県内滞在も含む'),
    }
    return {
      date,
      mapData,
      info,
      last7DaysSum,
    }
  },
})
